    return (
        <div className="d-flex justify-content-center bg-dark">
           <div className="col-md-2">
           <Sidebar/>
           </div>
           <div className="col-md-5">
           <Calendars/>
           </div>
           <div className="col-md-5">
           <AppointmentsByDate/>
           </div>
           
        
    
              
            
        </div>
    );
};

export default Dashboard;
